INSERT INTO race_collection (id, league_id, name, description, cat_id, prize1, prize2, prize3) VALUES (1, 2, 'Sunday Cup', 'The grassroots introduction to racing. No restrictions on car models.', 10, 5000, 3000, 2000);
INSERT INTO race_collection (id, league_id, name, description, cat_id, prize1, prize2, prize3) VALUES (2, 1, 'Clubman Cup', 'An event for beginners just getting the hang of racing. No restrctions on car models.', 11, 30000, 15000, 10000);
INSERT INTO race_collection (id, league_id, name, description, cat_id, prize1, prize2, prize3) VALUES (3, 2, 'FF Challenge', 'Master Front wheel drive sports cars with understeer.', 10, 6000, 3500, 2500);
INSERT INTO race_collection (id, league_id, name, description, cat_id, prize1, prize2, prize3) VALUES (4, 2, 'Clio cup', 'A one-make race in the Renault Clio for beginner racers.', 8, 7000, 4000, 3000);
INSERT INTO race_collection (id, league_id, name, description, cat_id, prize1, prize2, prize3) VALUES (5, 2, 'Mazda Roadsters Cup', 'A one-make series for Mazda Roadsters, providing an entry level race category.', 7, 10000, 6000, 4000);
INSERT INTO race_collection (id, league_id, name, description, cat_id, prize1, prize2, prize3) VALUES (6, 2, 'F-150 Raptor Survial', 'the final word in American pickup trucks. A Ford F-150 one-make event.', 10, 12000, 8000, 6000);
INSERT INTO race_collection (id, league_id, name, description, cat_id, prize1, prize2, prize3) VALUES (7, 2, 'Stars & Stripes', 'The race to find the fastest most menacing American sports carl Cany you handle the power?', 10, 13000, 9000, 7000);
INSERT INTO race_collection (id, league_id, name, description, cat_id, prize1, prize2, prize3) VALUES (8, 2, 'Nissan GT-R Cup', 'A one-make race for the GT-R, featuring Nissan''s iconic sparts car.', 10, 14000, 10000, 9000);
INSERT INTO race_collection (id, league_id, name, description, cat_id, prize1, prize2, prize3) VALUES (9, 2, 'Competition de France', 'Cute, sporty, a clash of the unique. An event for French Cars.', 9, 11000, 7000, 5000);
INSERT INTO race_collection (id, league_id, name, description, cat_id, prize1, prize2, prize3) VALUES (10, 2, 'Group 4 Cup', 'You''ll find plenty of power and excellent handling in these Group 4 races.', 4, 17000, 13000, 10000);
INSERT INTO race_collection (id, league_id, name, description, cat_id, prize1, prize2, prize3) VALUES (11, 2, 'Lightweight K Cup', 'This race consists of compact cars available only in Japan, powered by 660-cc engines.', 7, 9500, 6000, 4000);
INSERT INTO race_collection (id, league_id, name, description, cat_id, prize1, prize2, prize3) VALUES (12, 2, 'Beetle & Samba Bus Fest', 'Two uniquely-shaped vehicles with air-cooled flat-4 engines from the good ol''days, the Volkswagen "Beetle" and the Samba Bus, are featured in this event.', 7, 10500, 6500, 5000);
INSERT INTO race_collection (id, league_id, name, description, cat_id, prize1, prize2, prize3) VALUES (13, 2, 'The Passion of Dr. Wankel', 'A special event for cars powered by the rotary engine, which was invented by Felix Wankel of Germany.', 10, 10000, 6000, 4000);
INSERT INTO race_collection (id, league_id, name, description, cat_id, prize1, prize2, prize3) VALUES (14, 2, 'Mini Challenge', 'MINI fans unite! An event for the cute but quick MINI Cooper.', 7, 10000, 6000, 4000);
INSERT INTO race_collection (id, league_id, name, description, cat_id, prize1, prize2, prize3) VALUES (15, 2, 'Z Heritage', 'The "Z" only event for Nissan''s iconic front-engine rear-wheel-drive sports car, with its flowing body and high-powered engine.', 9, 12500, 8500, 6500);
INSERT INTO race_collection (id, league_id, name, description, cat_id, prize1, prize2, prize3) VALUES (16, 2, 'FR Challenge', 'A race series limited to front-engine/rear-wheel drive cars. Hone your countersteering technique.', 10, 8000, 4500, 3500);
INSERT INTO race_collection (id, league_id, name, description, cat_id, prize1, prize2, prize3) VALUES (17, 1, 'Tourist Trophy', 'A one-make race series for the Audi TT, crowned with its own name.', 9, 35000, 20000, 12000);
INSERT INTO race_collection (id, league_id, name, description, cat_id, prize1, prize2, prize3) VALUES (18, 1, '4WD Challenge', 'Races for four-wheel drives, with everything from 4-door sedans to supercars.', 10, 40000, 25000, 15000);
INSERT INTO race_collection (id, league_id, name, description, cat_id, prize1, prize2, prize3) VALUES (19, 1, 'FR Challenge +', 'The intermediate level series of the FR Challenge, limited to front-engine rear-wheel drives.', 12, 45000, 28000, 18000);
INSERT INTO race_collection (id, league_id, name, description, cat_id, prize1, prize2, prize3) VALUES (20, 1, 'Boxer Spirit', 'A race series for cars with horizontally-ooposed engines. Enjoy their low center of gravity and bask in their unique sounds.', 11, 50000, 30000, 20000);
INSERT INTO race_collection (id, league_id, name, description, cat_id, prize1, prize2, prize3) VALUES (21, 1, 'Mazda Roadsters Cup +', 'An intermediate level category for the one-make series with the Mazda Roadster.', 7, 55000, 33000, 22000);
INSERT INTO race_collection (id, league_id, name, description, cat_id, prize1, prize2, prize3) VALUES (22, 1, 'J-Sports Meeting', 'A diverse assortment of unique and high performance Japanese sports cars.', 9, 57000, 36000, 25000);
INSERT INTO race_collection (id, league_id, name, description, cat_id, prize1, prize2, prize3) VALUES (23, 1, 'Vision Gran Turismo Trophy', 'A competition of Vision Gran Turismo vehicles, which represent the pinnacle of technology and design.', 6, 60000, 38000, 28000);
INSERT INTO race_collection (id, league_id, name, description, cat_id, prize1, prize2, prize3) VALUES (24, 1, 'Red Bull X-Junior Series', 'Entry Level Red Bull X Series, X2014 Jr. One-Make Race.', 6, 65000, 40000, 33000);
INSERT INTO race_collection (id, league_id, name, description, cat_id, prize1, prize2, prize3) VALUES (25, 1, 'Gr. B Rallycross', 'By grip or drift'' your fate lies in total control of your machine. this race is for Group B rally cars.', 5, 62000, 38000, 30000);
INSERT INTO race_collection (id, league_id, name, description, cat_id, prize1, prize2, prize3) VALUES (26, 1, 'World Hatchback Championship', 'This race features hatchbacks, which are cars with rear doors that open upward.', 9, 48000, 32000, 20000);
INSERT INTO race_collection (id, league_id, name, description, cat_id, prize1, prize2, prize3) VALUES (27, 1, 'Nostalgic Car Festival', 'With beautiful designs and sensuous sounds, these classics represent cars from a bygone era.', 10, 53000, 35000, 23000);
INSERT INTO race_collection (id, league_id, name, description, cat_id, prize1, prize2, prize3) VALUES (28, 1, 'Group 3 Cup', 'Stay focused and take the checkered flag in this Grp 3 battle of the bravest pilots.', 3, 58000, 37000, 26000);
INSERT INTO race_collection (id, league_id, name, description, cat_id, prize1, prize2, prize3) VALUES (29, 1, 'Real Circuit Tours', 'A race series on real-world tracks, involving non-racecars with 394 HP or less.', 10, 55000, 33000, 22000);
INSERT INTO race_collection (id, league_id, name, description, cat_id, prize1, prize2, prize3) VALUES (30, 1, 'Supra Legend', 'This special race event for the Toyota Supra features a group of the company''s high-powered front-engine/rear-wheel sports car developed for racing.', 9, 50000, 31000, 21000);
INSERT INTO race_collection (id, league_id, name, description, cat_id, prize1, prize2, prize3) VALUES (31, 1, 'Super Formula Championships', 'This one-make race features the Dallara SF19 from the Supoer Formula series, among the most preeminent motorsports categories in Japan.', 6, 110000, 60000, 40000);
INSERT INTO race_collection (id, league_id, name, description, cat_id, prize1, prize2, prize3) VALUES (32, 4, 'Midship Challenge', 'A race series for true sportscars with mid-engine layouts.', 12, 80000, 40000, 25000);
INSERT INTO race_collection (id, league_id, name, description, cat_id, prize1, prize2, prize3) VALUES (33, 4, 'Premium Sports Lounge', 'A high class race for supercars, hypercars, and premium cars.', 16, 100000, 50000, 30000);
INSERT INTO race_collection (id, league_id, name, description, cat_id, prize1, prize2, prize3) VALUES (34, 4, 'La Festa Cavallino', 'A festival of the prancing horses; a race series just for Ferraris.', 12, 120000, 70000, 50000);
INSERT INTO race_collection (id, league_id, name, description, cat_id, prize1, prize2, prize3) VALUES (35, 4, 'F1500 Championship', 'This race is limited to an old-school formula car, the F1500T-A, with wide, slick tires and a high-power engine.', 6, 180000, 100000, 70000);
INSERT INTO race_collection (id, league_id, name, description, cat_id, prize1, prize2, prize3) VALUES (36, 4, 'All Japan GT Car Championships', 'This race for the Group 2 category features pure racecars that maintain the look and feel of production cars.', 2, 200000, 110000, 80000);
INSERT INTO race_collection (id, league_id, name, description, cat_id, prize1, prize2, prize3) VALUES (37, 4, 'Vision Gran Turismo Trophy +', 'It doesn''t get any better than this dream race between Vision Gran Turismo machines. Which one will reign supreme?', 6, 150000, 90000, 60000);
INSERT INTO race_collection (id, league_id, name, description, cat_id, prize1, prize2, prize3) VALUES (38, 4, 'Lamborghini Cup', 'This festival of raging bulls is a race exclusive to Lambo''s', 12, 110000, 65000, 45000);
